import React from 'react';
import './Navbar.css'; // Assuming you'll style it using CSS

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="logo">
        <a href="/">August AI</a>
      </div>
      <ul className="nav-links">
        <li><a href="#features">Features</a></li>
        <li><a href="#how-it-works">How It Works</a></li>
        <li><a href="#proactive-support">Proactive Support</a></li>
        <li><a href="#faq">FAQ</a></li>
        <li><a href="#contact">Contact</a></li>
        <li><a href="https://www.meetaugust.ai/wa" target="_blank" rel="noopener noreferrer">Talk to August</a></li>
      </ul>
    </nav>
  );
};

export default Navbar;
